import "./Slide.css";

 

export default function Slide(props) {
 

	const {name,image,id}=props.categories
	return (
		<>
			<div className="item">
				<div className="category-item">
				
						<img
							className="img-fluid custom-slick-img"
						
							src={image==null ? 'img/category':image.src}
							alt="#"
							
					 />
						<h6 style={{fontWeight:'700'}}>
							 {name}
							  
						</h6>
					
				 
				</div>
			</div>
		</>
	);
}
